script: |
  super -f text -I q12381.spq | sort > q12381.out

inputs:
  - name: q12381.spq
    data: |
      SELECT ALL 37 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT - - col1 + 36 + - col0 + - col2 NOT BETWEEN CAST ( NULL AS INTEGER ) AND + - 96 * 98;
  - name: tab0

outputs:
  - name: q12381.out
    data: |
